import React, { useEffect, useState } from 'react';
import axios from 'axios';

function OrderItemsList() {
    const [orderItems, setOrderItems] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/api/order-items')
            .then(response => {
                setOrderItems(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('Błąd podczas pobierania danych:', error);
                setLoading(false);
            });
    }, []);

    if (loading) return <p>Ładowanie danych zamówień...</p>;

    return (
        <div style={{ padding: '20px' }}>
            <h2>Lista Zamówień (Order Items)</h2>
            <table border="1" cellPadding="10" cellSpacing="0" style={{ width: '100%', borderCollapse: 'collapse' }}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Klient ID</th>
                        <th>Produkt ID</th>
                        <th>Czas ID</th>
                        <th>Ilość</th>
                        <th>Wartość</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {orderItems.map(item => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.klient_id}</td>
                            <td>{item.produkt_id}</td>
                            <td>{item.czas_id}</td>
                            <td>{item.ilosc}</td>
                            <td>{item.wartosc}</td>
                            <td>{item.status}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default OrderItemsList;
